import React from "react"
import Header from "./Header"
import Main from "./Main"
import Footer from "./Footer"
import Time from "./Time"
import './App.css';

function App()
{
  //This fuction is used for displaying header,main,footer content
  return(
    <div>
      <Header />
      <Main />
      <Footer />
      <Time />
    </div>

  )
}

function myFunction() {
  var y="KS";
  var x = Math.floor((Math.random() * 100000000) + 1);
  document.getElementById("demo").innerHTML =y+x;
}

export default {App,myFunction}
